import React from 'react';
import { Star, Heart, HeartFill } from 'lucide-react';

const SpaceCard = ({ space, onFavorite, isFavorite, onReserve }) => {
  const handleFavoriteClick = () => {
    onFavorite(space.id);
  };

  return (
    <div className="border rounded-lg shadow-md p-4 bg-white relative">
      <img
        src={space.image || 'https://via.placeholder.com/150'}
        alt={space.name}
        className="w-full h-48 object-cover rounded-t-lg"
      />
      <div className="p-4">
        <h2 className="text-lg font-bold text-gray-800 mb-2">{space.name}</h2>
        <p className="text-gray-600 mb-4">{space.location}</p>
        <p className="text-gray-800 font-semibold">${space.price} / mes</p>

        <div className="flex items-center mt-2 mb-4">
          {Array.from({ length: 5 }).map((_, index) => (
            <Star
              key={index}
              className={`h-5 w-5 ${index < space.rating ? 'text-yellow-400' : 'text-gray-300'}`}
            />
          ))}
        </div>

        <button
          onClick={() => onReserve(space.id)}
          className="bg-blue-500 text-white py-2 px-4 rounded hover:bg-blue-600 transition mb-2 w-full"
        >
          Reservar
        </button>
      </div>

      <button
        onClick={handleFavoriteClick}
        className="absolute top-4 right-4 text-red-500"
        aria-label="Favorito"
      >
        {isFavorite ? <HeartFill className="h-6 w-6" /> : <Heart className="h-6 w-6" />}
      </button>
    </div>
  );
};

export default SpaceCard;
